import React from 'react'
import { TextField, Container, Grid, Button } from '@material-ui/core';
import { withRouter } from 'react-router';
import { sendMessage } from '../../Data/Api/MessageApi';
import { useState } from 'react';


function Contact() {

    const [values, setValues] = useState({
        name: "",
        email: "",
        body: "",
        subject: ""
    })

    const onChange = e => {
        const {name, value} = e.target;
        setValues({
            ...values,
            [name]: value
        })
    }

    const onSubmit = async (e) => {
        e.preventDefault();
        const { name, email, subject, body } = e.target;
        const message = {
            name: name.value,
            body: body.value,
            ...(!!subject.value && {subject: subject.value}),
            ...(!!email.value && {email: email.value})
        }; 

        // sendMessage(message);
    }

    return (
        <div>
            <Container maxWidth='sm' >
                <h1>Contact</h1>
                <form onSubmit={onSubmit}>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField id="outlined-basic" label="Name" variant="outlined" name='name' value={values.name} fullWidth/>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField id="outlined-basic" label="Email" variant="outlined" name='email' value={values.email} fullWidth/>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField id="outlined-basic" label="Subject" variant="outlined" name='subject' value={values.subject} fullWidth/>
                        </Grid>
                        <Grid item xs={12}>
                            <TextField id="outlined-basic" label="Message" variant="outlined" name='body' value={values.body}  fullWidth multiline rows={3}/>
                        </Grid>
                        <Button type="submit" variant="contained"> Send</Button>
                    </Grid>
                </form>
            </Container>
        </div>
    )
}

export default withRouter(Contact)
